  constructor(props){
    super(props)
    this.state = {
      data : this.props.data,
      tabletMani : []
    }
  }

  componentDidMount(){
  	this.fetchManiData()
  }


  async fetchManiData() {

	console.log('fetching MANI')
	// const { assetInfo : { id=null, gps=null }} = this.state


	if (gps === null){
		console.log('This asset has no GPSID')
	}else{
		let bodyData = {
		'params': {
			'id': id,
			'gpsid': gps
			}}
		const makeRequest = await fetch('/mani', {
	        method: 'POST',
	        body: JSON.stringify(bodyData),
	        headers: {'Content-Type': 'application/json'}
	    })
	    console.log('End',makeRequest)
		const getManiData = await makeRequest.json()
		console.log(getManiData)


		if (makeRequest.status === 200) {
			if (getManiData.error) {
				console.log('Error in server bud')
				this.setState({maniexists : false})
			}else{
				if (getManiData) {
					this.setState({data : getManiData.maniresponse})
					console.log(getManiData)
				}else{
					this.setState({pathexists : false})
				}
			}
		}
	}

	return 'Done'
	}

  render(){
  	// const {assetInfo, packageManifest} = this.state

  	console.log('from tablet',this)
